export default function Navbar({addedClassList}){
    return (
        <div className = {`flex flex-row w-full` + " " + addedClassList}>

            <div className = "float-left">
                <p>All this floats left</p>
            </div>
            
            <div className = "float-right">
                <p>All this floats right</p>
            </div>

        </div>
    )
}
